// components/Footer.js
import React from 'react';

const Footer = () => {
  return (
    <footer>
      <div className='fotter-container'>
        {/* Kontak Kami */}
        <div>
          <h2>Hubungi Kami</h2>
          <p>Jika Anda memiliki pertanyaan, silakan hubungi kami di support@example.com.</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
